  <p>Sobre el numeral 1. del Orden del D\xEDa, hace uso de la palabra la se\xF1orita Presidenta Ad Hoc que solicita a la Secretaria Ad Hoc  de lectura al Informe Presentado por el Gerente, se\xF1or {{ nombregerente }} correspondiente a su administraci\xF3n durante el ejercicio econ\xF3mico {{ periodoactual }}, el cual es propuesto para su aprobaci\xF3n.</p>
